script: |
  super -f text -I q771.spq | sort > q771.out

inputs:
  - name: q771.spq
    data: |
      SELECT DISTINCT cor0.col1 * 64 FROM tab0 (FORMAT parquet) cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q771.out
    data: |
      5504
      5824
      6208
